import React from 'react';
import instagram from '../images/instagram.png'
import facebook from '../images/facebook.png'

export default function SocialMedia({thisMidea}) {
  return(
    <footer>
      <img 
      alt="Instagran"
      src={ instagram }
      width="50px"
      />
      { thisMidea ?(       
        <img
        alt="Facebook"
        src={ facebook }
        width="50px"
        />
        ) : null
      }
    </footer>
  );
}
